# collections of all the averaged terms / function to compute averaged terms due to atmospheric drag in the attitude equations of motion 
#################################################################################################################################################

#################################################################################################################################################
# AVERAGE WITH RESPECT TO MEAN ANOMALY (ANALYTICAL) --- for attitude equations
##################################################################################################################################################
# averaged over the mean anomaly
"""
    getAveragedScSunUnitVector(rSunV,sma,P1,P2,q11,q12,q13,q21,q22,q23,edeg,includeEclipsesEffects,inshadow,ELin,ELout)
    Consider the coefficients contained in the solar radiation pressure, depending 
    on the orbital elements. The function compute their mean value with respect to the orbital mean anomaly.

    INPUT:
    rSunV = position vector of the Sun
    sma = semi-major axis 
    P1  = ec*sin(om+OM), om = argument of the pericenter, OM = right ascension of the ascending node
    P2  = ec*cos(om+OM) 
    q11 = (1.0-Q1^2.0+Q2^2.0)/GG, Q1  = tan(incl/2)sin(OM), Q2  = tan(incl/2)cos(OM), incl = inclination,  GG  = 1+Q1^2+Q2^2;
    q12 = (2.0*Q1*Q2)/GG;
    q13 = (-2.0*Q1)/GG;
    q21 = (2.0*Q1*Q2)/GG;
    q22 = (1.0+Q1^2.0-Q2^2.0)/GG;
    q23 = (2.0*Q2)/GG;
    edeg = integer between = 0 and 2 -- the terms depending on the orbital elements are developed in a series of the parameter r/norm(rSunV), r= the distance between the body and the central body **
    includeEclipsesEffects = boolean : if true the eclipses effects are considered, if false the body is considered in sun-light (even if it is not)
    inshadowoccurs = boolean: if true part of the orbit is in shadow; if false the orbit is in sun-light (if includeEclipsesEffects, set passageinshadowoccurs = false)
    Elin  = value of the eccentric longitude at the entrance of the shadow region (if passageinshadowoccurs, set  Elinshadow = NaN)
    Elout = value of the eccentric longitude at the exit from the shadow region (if passageinshadowoccurs, set  Eloutshadow = NaN)

    ** edeg == 2 is deprecable: the terms of degree 2 or larger in (r/norm(rSunV)) are negligible 

    OUTPUT: 
    vvcu = [1, cU3, cU3^2, cU3^3, cU2, cU2*cU3, cU2*cU3^2, cU2^2, cU2^2*cU3, cU2^3, cU1, cU1*cU3, cU1*cU3^2, cU1*cU2, cU1*cU2*cU3, cU1*cU2^2, cU1^2, cU1^2*cU3, cU1^2*cU2, cU1^3]
        with cU1,cU2,cU3 direct cosines of rSunV expressed in the inertial ref frame, averaged with respect to the orbital mean anomaly
   
"""
function getAveragedScSunUnitVector(rSunV,sma,P1,P2,q11,q12,q13,q21,q22,q23,edeg,includeEclipsesEffects,inshadow,ELin,ELout)

    if edeg>2
        Base.error("edeg can be 0, 1 or 2 (deprecable)")
    end

    rsunnorm = sqrt(rSunV[1]^2.0+rSunV[2]^2.0+rSunV[3]^2.0);

    cs1 = rSunV[1]/rsunnorm; 
    cs2 = rSunV[2]/rsunnorm;  
    cs3 = rSunV[3]/rsunnorm; 
   
    eta  = sqrt(1.0-P1^2.0-P2^2.0);
    beta = cs1*q11 + cs2*q12 + cs3*q13;
    xi   = cs1*q21 + cs2*q22 + cs3*q23;   

    # coeffs deg 0 ###########################
    vcucoeff = getCoeffScSunUnitVector_deg0(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3);

    if edeg>=1
        vcucoeff = vcucoeff + getCoeffScSunUnitVector_deg1(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3);
        vcucoeff = vcucoeff + getCoeffScSunUnitVector_deg1_corrpsrp(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3);
    end

    if edeg>=2
        vcucoeff = vcucoeff + getCoeffScSunUnitVector_deg2(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3);
        vcucoeff = vcucoeff + getCoeffScSunUnitVector_deg2_corrpsrp(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3);
    end
        
    # average
    if includeEclipsesEffects && inshadow
        if ELin<ELout
           VAT = ((averagedterm(ELin)-averagedterm(0.0))+(averagedterm(2.0*pi)-averagedterm(ELout)))/2.0/pi;
        else
           VAT = (averagedterm(ELin)-averagedterm(ELout))/2.0/pi;
        end
    else
           VAT = (averagedterm(2.0*pi)-averagedterm(0.0))/2.0/pi;
    end 

    vcu = zeros(20,1); 
    for jj=1:20
        vcu[jj] = LinearAlgebra.dot(vcucoeff[jj,:],VAT);
    end

    return vcu;
    
end

function getCoeffScSunUnitVector_deg0(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3)
    vcucoeff0 = zeros(20,8);
   
    vcucoeff0[1,1] = 1.0
    vcucoeff0[1,2] = -P1
    vcucoeff0[1,3] = -P2
    vcucoeff0[2,1] = cs3
    vcucoeff0[2,2] = -P1 * cs3
    vcucoeff0[2,3] = -P2 * cs3
    vcucoeff0[3,1] = cs3 ^ 2
    vcucoeff0[3,2] = -P1 * cs3 ^ 2
    vcucoeff0[3,3] = -P2 * cs3 ^ 2
    vcucoeff0[4,1] = cs3 ^ 3
    vcucoeff0[4,2] = -cs3 ^ 3 * P1
    vcucoeff0[4,3] = -cs3 ^ 3 * P2
    vcucoeff0[5,1] = cs2
    vcucoeff0[5,2] = -P1 * cs2
    vcucoeff0[5,3] = -P2 * cs2
    vcucoeff0[6,1] = cs2 * cs3
    vcucoeff0[6,2] = -P1 * cs2 * cs3
    vcucoeff0[6,3] = -P2 * cs2 * cs3
    vcucoeff0[7,1] = cs2 * cs3 ^ 2
    vcucoeff0[7,2] = -P1 * cs2 * cs3 ^ 2
    vcucoeff0[7,3] = -P2 * cs2 * cs3 ^ 2
    vcucoeff0[8,1] = cs2 ^ 2
    vcucoeff0[8,2] = -P1 * cs2 ^ 2
    vcucoeff0[8,3] = -P2 * cs2 ^ 2
    vcucoeff0[9,1] = cs2 ^ 2 * cs3
    vcucoeff0[9,2] = -P1 * cs2 ^ 2 * cs3
    vcucoeff0[9,3] = -P2 * cs2 ^ 2 * cs3
    vcucoeff0[10,1] = cs2 ^ 3
    vcucoeff0[10,2] = -cs2 ^ 3 * P1
    vcucoeff0[10,3] = -cs2 ^ 3 * P2
    vcucoeff0[11,1] = cs1
    vcucoeff0[11,2] = -P1 * cs1
    vcucoeff0[11,3] = -P2 * cs1
    vcucoeff0[12,1] = cs1 * cs3
    vcucoeff0[12,2] = -P1 * cs1 * cs3
    vcucoeff0[12,3] = -P2 * cs1 * cs3
    vcucoeff0[13,1] = cs1 * cs3 ^ 2
    vcucoeff0[13,2] = -P1 * cs1 * cs3 ^ 2
    vcucoeff0[13,3] = -P2 * cs1 * cs3 ^ 2
    vcucoeff0[14,1] = cs1 * cs2
    vcucoeff0[14,2] = -P1 * cs1 * cs2
    vcucoeff0[14,3] = -P2 * cs1 * cs2
    vcucoeff0[15,1] = cs1 * cs2 * cs3
    vcucoeff0[15,2] = -P1 * cs1 * cs2 * cs3
    vcucoeff0[15,3] = -P2 * cs1 * cs2 * cs3
    vcucoeff0[16,1] = cs1 * cs2 ^ 2
    vcucoeff0[16,2] = -P1 * cs1 * cs2 ^ 2
    vcucoeff0[16,3] = -P2 * cs1 * cs2 ^ 2
    vcucoeff0[17,1] = cs1 ^ 2
    vcucoeff0[17,2] = -P1 * cs1 ^ 2
    vcucoeff0[17,3] = -P2 * cs1 ^ 2
    vcucoeff0[18,1] = cs1 ^ 2 * cs3
    vcucoeff0[18,2] = -P1 * cs1 ^ 2 * cs3
    vcucoeff0[18,3] = -P2 * cs1 ^ 2 * cs3
    vcucoeff0[19,1] = cs1 ^ 2 * cs2
    vcucoeff0[19,2] = -P1 * cs1 ^ 2 * cs2
    vcucoeff0[19,3] = -P2 * cs1 ^ 2 * cs2
    vcucoeff0[20,1] = cs1 ^ 3
    vcucoeff0[20,2] = -cs1 ^ 3 * P1
    vcucoeff0[20,3] = -cs1 ^ 3 * P2

    return vcucoeff0;
end

function getCoeffScSunUnitVector_deg1(sma,P1,P2,q11,q12,q13,q21,q22,q23,beta,xi,eta,rsunnorm,cs1,cs2,cs3)
    vcucoeff1 = zeros(20,8);

    vcucoeff1[2,1] = -(P1 ^ 3 * xi * cs3 + P2 * (beta * cs3 - q13) * P1 ^ 2 + (q23 * P2 ^ 2 + (2 * eta * xi + xi) * cs3 - 2 * q23 * (1 + eta)) * P1 + P2 * (1 + eta) * (beta * cs3 - q13)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[2,2] = sma * (((cs3 * xi - q23) * eta + 2 * cs3 * xi - q23) * P1 ^ 2 + P2 * (eta + 2) * (beta * cs3 - q13) * P1 + (cs3 * xi - q23) * eta + q23 * (P2 ^ 2 - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[2,3] = -sma * (-(1 + eta) * (beta * cs3 - q13) * P2 ^ 2 - P1 * (eta + 2) * (cs3 * xi - q23) * P2 + (P1 ^ 2 - eta - 1) * (beta * cs3 - q13)) / rsunnorm / (1 + eta)
    vcucoeff1[2,4] = sma * ((beta * cs3 - q13) * P1 ^ 3 - 2 * P2 * (cs3 * xi - q23 / 2) * P1 ^ 2 - (P2 ^ 2 + eta + 1) * (beta * cs3 - q13) * P1 - P2 * (q23 * P2 ^ 2 + eta * xi * cs3 - q23 * (1 + eta))) / rsunnorm / (1 + eta)
    vcucoeff1[2,5] = 2 * (P1 ^ 3 * xi * cs3 / 2 + P2 * (beta * cs3 - q13) * P1 ^ 2 + ((-cs3 * xi / 2 + q23) * P2 ^ 2 + eta * xi * cs3 / 2 - q23 * (1 + eta) / 2) * P1 - P2 * (1 + eta) * (beta * cs3 - q13) / 2) * sma / rsunnorm / (1 + eta)
    vcucoeff1[3,1] = -2 * cs3 * (P1 ^ 3 * xi * cs3 + P2 * (beta * cs3 - q13) * P1 ^ 2 + ((2 * eta * xi + xi) * cs3 + q23 * (P2 ^ 2 - 2 * eta - 2)) * P1 + P2 * (1 + eta) * (beta * cs3 - q13)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[3,2] = 2 * cs3 * sma * (((cs3 * xi - q23) * eta + 2 * cs3 * xi - q23) * P1 ^ 2 + P2 * (eta + 2) * (beta * cs3 - q13) * P1 + (cs3 * xi - q23) * eta + q23 * (P2 ^ 2 - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[3,3] = -2 * cs3 * sma * ((-beta * (1 + eta) * P2 ^ 2 - P2 * xi * (eta + 2) * P1 + beta * (P1 ^ 2 - eta - 1)) * cs3 + q13 * (1 + eta) * P2 ^ 2 + q23 * P2 * (eta + 2) * P1 - q13 * (P1 ^ 2 - eta - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[3,4] = 2 * cs3 * sma * ((beta * cs3 - q13) * P1 ^ 3 - 2 * P2 * (cs3 * xi - q23 / 2) * P1 ^ 2 - (P2 ^ 2 + eta + 1) * (beta * cs3 - q13) * P1 - P2 * (q23 * P2 ^ 2 + eta * xi * cs3 - q23 * (1 + eta))) / rsunnorm / (1 + eta)
    vcucoeff1[3,5] = 4 * (P1 ^ 3 * xi * cs3 / 2 + P2 * (beta * cs3 - q13) * P1 ^ 2 + ((-cs3 * xi / 2 + q23) * P2 ^ 2 + eta * xi * cs3 / 2 - q23 * (1 + eta) / 2) * P1 - P2 * (1 + eta) * (beta * cs3 - q13) / 2) * cs3 * sma / rsunnorm / (1 + eta)
    vcucoeff1[4,1] = -3 * cs3 ^ 2 * (P1 ^ 3 * xi * cs3 + P2 * (beta * cs3 - q13) * P1 ^ 2 + ((2 * eta * xi + xi) * cs3 + q23 * (P2 ^ 2 - 2 * eta - 2)) * P1 + P2 * (1 + eta) * (beta * cs3 - q13)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[4,2] = 3 * cs3 ^ 2 * sma * (((cs3 * xi - q23) * eta + 2 * cs3 * xi - q23) * P1 ^ 2 + P2 * (eta + 2) * (beta * cs3 - q13) * P1 + (cs3 * xi - q23) * eta + q23 * (P2 ^ 2 - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[4,3] = -3 * cs3 ^ 2 * sma * ((-beta * (1 + eta) * P2 ^ 2 - P2 * xi * (eta + 2) * P1 + beta * (P1 ^ 2 - eta - 1)) * cs3 + q13 * (1 + eta) * P2 ^ 2 + q23 * P2 * (eta + 2) * P1 - q13 * (P1 ^ 2 - eta - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[4,4] = 3 * cs3 ^ 2 * sma * ((beta * cs3 - q13) * P1 ^ 3 - 2 * P2 * (cs3 * xi - q23 / 2) * P1 ^ 2 - (P2 ^ 2 + eta + 1) * (beta * cs3 - q13) * P1 - P2 * (q23 * P2 ^ 2 + eta * xi * cs3 - q23 * (1 + eta))) / rsunnorm / (1 + eta)
    vcucoeff1[4,5] = 6 * (P1 ^ 3 * xi * cs3 / 2 + P2 * (beta * cs3 - q13) * P1 ^ 2 + ((-cs3 * xi / 2 + q23) * P2 ^ 2 + eta * xi * cs3 / 2 - q23 * (1 + eta) / 2) * P1 - P2 * (1 + eta) * (beta * cs3 - q13) / 2) * cs3 ^ 2 * sma / rsunnorm / (1 + eta)
    vcucoeff1[5,1] = -(P1 ^ 3 * xi * cs2 + P2 * (beta * cs2 - q12) * P1 ^ 2 + (q22 * P2 ^ 2 + (2 * eta * xi + xi) * cs2 - 2 * q22 * (1 + eta)) * P1 + P2 * (1 + eta) * (beta * cs2 - q12)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[5,2] = sma * (((cs2 * xi - q22) * eta + 2 * cs2 * xi - q22) * P1 ^ 2 + P2 * (eta + 2) * (beta * cs2 - q12) * P1 + (cs2 * xi - q22) * eta + q22 * (P2 ^ 2 - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[5,3] = -sma * (-(1 + eta) * (beta * cs2 - q12) * P2 ^ 2 - P1 * (eta + 2) * (cs2 * xi - q22) * P2 + (P1 ^ 2 - eta - 1) * (beta * cs2 - q12)) / rsunnorm / (1 + eta)
    vcucoeff1[5,4] = sma * ((beta * cs2 - q12) * P1 ^ 3 - 2 * P2 * (cs2 * xi - q22 / 2) * P1 ^ 2 - (P2 ^ 2 + eta + 1) * (beta * cs2 - q12) * P1 - P2 * (q22 * P2 ^ 2 + eta * xi * cs2 - q22 * (1 + eta))) / rsunnorm / (1 + eta)
    vcucoeff1[5,5] = 2 * (P1 ^ 3 * xi * cs2 / 2 + P2 * (beta * cs2 - q12) * P1 ^ 2 + ((-cs2 * xi / 2 + q22) * P2 ^ 2 + eta * xi * cs2 / 2 - q22 * (1 + eta) / 2) * P1 - P2 * (1 + eta) * (beta * cs2 - q12) / 2) * sma / rsunnorm / (1 + eta)
    vcucoeff1[6,1] = sma * (((-2 * P1 ^ 3 * xi - 2 * beta * P1 ^ 2 * P2 + (-4 * eta * xi - 2 * xi) * P1 - 2 * beta * P2 * (1 + eta)) * cs3 + q13 * P1 ^ 2 * P2 - q23 * (P2 ^ 2 - 2 * eta - 2) * P1 + q13 * P2 * (1 + eta)) * cs2 - (-q12 * P1 ^ 2 * P2 + q22 * (P2 ^ 2 - 2 * eta - 2) * P1 - q12 * P2 * (1 + eta)) * cs3) / rsunnorm / (1 + eta)
    vcucoeff1[6,2] = -(((-2 * xi * (eta + 2) * P1 ^ 2 - 2 * beta * P2 * (eta + 2) * P1 - 2 * eta * xi) * cs3 + q23 * (1 + eta) * P1 ^ 2 + q13 * P2 * (eta + 2) * P1 - q23 * (P2 ^ 2 - eta - 1)) * cs2 + (q22 * (1 + eta) * P1 ^ 2 + q12 * P2 * (eta + 2) * P1 - q22 * (P2 ^ 2 - eta - 1)) * cs3) * sma / rsunnorm / (1 + eta)
    vcucoeff1[6,3] = (((2 * beta * (1 + eta) * P2 ^ 2 + 2 * P2 * xi * (eta + 2) * P1 - 2 * beta * (P1 ^ 2 - eta - 1)) * cs3 - q13 * (1 + eta) * P2 ^ 2 - q23 * P2 * (eta + 2) * P1 + q13 * (P1 ^ 2 - eta - 1)) * cs2 - (q12 * (1 + eta) * P2 ^ 2 + q22 * P2 * (eta + 2) * P1 - q12 * (P1 ^ 2 - eta - 1)) * cs3) * sma / rsunnorm / (1 + eta)
    vcucoeff1[6,4] = -(((-2 * beta * cs3 + q13) * cs2 + q12 * cs3) * P1 ^ 3 - ((-4 * cs3 * xi + q23) * cs2 + q22 * cs3) * P2 * P1 ^ 2 - ((-2 * beta * cs3 + q13) * cs2 + q12 * cs3) * (P2 ^ 2 + eta + 1) * P1 + ((2 * eta * xi * cs3 + q23 * (P2 ^ 2 - eta - 1)) * cs2 + q22 * cs3 * (P2 ^ 2 - eta - 1)) * P2) * sma / rsunnorm / (1 + eta)
    vcucoeff1[6,5] = -2 * (((-P1 ^ 3 * xi - 2 * beta * P1 ^ 2 * P2 + xi * (P2 ^ 2 - eta) * P1 + beta * P2 * (1 + eta)) * cs3 + q13 * P1 ^ 2 * P2 - q23 * (P2 ^ 2 - eta / 2 - 1/2) * P1 - q13 * P2 * (1 + eta) / 2) * cs2 - cs3 * (-q12 * P1 ^ 2 * P2 + q22 * (P2 ^ 2 - eta / 2 - 1/2) * P1 + q12 * P2 * (1 + eta) / 2)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[7,1] = 2 * (((-3/2 * P1 ^ 3 * xi - 3/2 * beta * P1 ^ 2 * P2 - 3 * (eta + 1/2) * xi * P1 - 3/2 * beta * P2 * (1 + eta)) * cs2 + q12 * P1 ^ 2 * P2 / 2 - q22 * (P2 ^ 2 - 2 * eta - 2) * P1 / 2 + q12 * P2 * (1 + eta) / 2) * cs3 + (q13 * P1 ^ 2 * P2 - q23 * (P2 ^ 2 - 2 * eta - 2) * P1 + q13 * P2 * (1 + eta)) * cs2) * cs3 * sma / rsunnorm / (1 + eta)
    vcucoeff1[7,2] = -2 * (((-3/2 * xi * (eta + 2) * P1 ^ 2 - 3/2 * beta * P2 * (eta + 2) * P1 - 3/2 * eta * xi) * cs2 + q22 * (1 + eta) * P1 ^ 2 / 2 + q12 * P2 * (eta + 2) * P1 / 2 - q22 * (P2 ^ 2 - eta - 1) / 2) * cs3 + cs2 * (q23 * (1 + eta) * P1 ^ 2 + q13 * P2 * (eta + 2) * P1 - q23 * (P2 ^ 2 - eta - 1))) * cs3 * sma / rsunnorm / (1 + eta)
    vcucoeff1[7,3] = 2 * (((3/2 * beta * (1 + eta) * P2 ^ 2 + 3/2 * P2 * xi * (eta + 2) * P1 - 3/2 * beta * (P1 ^ 2 - eta - 1)) * cs2 - q12 * (1 + eta) * P2 ^ 2 / 2 - q22 * P2 * (eta + 2) * P1 / 2 + q12 * (P1 ^ 2 - eta - 1) / 2) * cs3 + (-q13 * (1 + eta) * P2 ^ 2 - q23 * P2 * (eta + 2) * P1 + q13 * (P1 ^ 2 - eta - 1)) * cs2) * cs3 * sma / rsunnorm / (1 + eta)
    vcucoeff1[7,4] = -2 * cs3 * (((q12 / 2 - 3/2 * beta * cs2) * P1 ^ 3 - P2 * (-6 * cs2 * xi + q22) * P1 ^ 2 / 2 + 3/2 * (beta * cs2 - q12 / 3) * (P2 ^ 2 + eta + 1) * P1 + P2 * (3 * eta * xi * cs2 + q22 * (P2 ^ 2 - eta - 1)) / 2) * cs3 + cs2 * (q13 * P1 ^ 3 - q23 * P1 ^ 2 * P2 - q13 * (P2 ^ 2 + eta + 1) * P1 + q23 * P2 * (P2 ^ 2 - eta - 1))) * sma / rsunnorm / (1 + eta)
    vcucoeff1[7,5] = -4 * cs3 * sma * (((-3/4 * P1 ^ 3 * xi - 3/2 * beta * P1 ^ 2 * P2 + 3/4 * xi * (P2 ^ 2 - eta) * P1 + 3/4 * beta * P2 * (1 + eta)) * cs2 + q12 * P1 ^ 2 * P2 / 2 - q22 * (P2 ^ 2 - eta / 2 - 1/2) * P1 / 2 - q12 * P2 * (1 + eta) / 4) * cs3 + cs2 * (q13 * P1 ^ 2 * P2 - q23 * (P2 ^ 2 - eta / 2 - 1/2) * P1 - q13 * P2 * (1 + eta) / 2)) / rsunnorm / (1 + eta)
    vcucoeff1[8,1] = -2 * cs2 * (P1 ^ 3 * xi * cs2 + P2 * (beta * cs2 - q12) * P1 ^ 2 + ((2 * eta * xi + xi) * cs2 + q22 * (P2 ^ 2 - 2 * eta - 2)) * P1 + P2 * (1 + eta) * (beta * cs2 - q12)) * sma / rsunnorm / (1 + eta)
    vcucoeff1[8,2] = 2 * cs2 * sma * (((cs2 * xi - q22) * eta + 2 * cs2 * xi - q22) * P1 ^ 2 + P2 * (eta + 2) * (beta * cs2 - q12) * P1 + (cs2 * xi - q22) * eta + q22 * (P2 ^ 2 - 1)) / rsunnorm / (1 + eta)
    vcucoeff1[8,3] = -2 * cs2 * sma * ((-beta * (1 + eta) * P2 ^ 2 - P2 * xi * (eta + 2) * P1 + beta * (P1 ^ 2 - eta - 1)) * cs2 + q12 * (1 + eta) * P2 ^ 2 + q22 * P2 * (eta + 2) * P1 - q12 * (P1 ^ 2 - eta - 1)) / rsunnorm / (1 + eta)
