function averagedterm(EL)
  VAT =  [EL, -cos(EL), sin(EL), 1.0/2.0*sin(EL)^2.0, 1.0/2.0*cos(EL)*sin(EL) + 1.0/2.0*EL, -1.0/3.0*cos(EL)^3.0, 1.0/3.0*(2.0 + cos(EL)^2.0)*sin(EL), -1.0/4.0*cos(EL)^4.0];
  return VAT;
end

#################################################################################################################################################
# AVERAGE WITH RESPECT TO ATTITUDE FAST ANGLES (ANALYTICAL) -- for attitude equations
##################################################################################################################################################
# averaged parts
"""
    srpanalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vcu)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Sadov angles. These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(sadov,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).   
    This function gives the average of the coefficients CC with respect to the Sadov angles psil and psig.
    Here, the part of the srp torque depending on optic coefficient cai is considered

    INPUT:
    Consider the Sadov variables (Jl,Jg,Jh,psil,psig,psih)
    k    = C/A*(B-A)/(C-B), A,B,C moments of inertia
    k1r  = sqrt(1+k)
    skm  = k/(m+k)
    smk  = m/(k+m)
    m    = sadov implicit function of the actions Jl and Jg
    KK   = complete elliptic integral of first kind with parameter m
    T1, T2, T3, T6 = variables including the false singularity m=0
    cdelta = Jh/Jg
    sdelta = sqrt(1-Jh^2/Jg^2)
    cpsih  = cos(psih)
    spsih  = sin(psih)
    vcu    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn*Sj.    
"""
function srpanalyticalaveragedcoeff_T1(k,k1r,skm,smk,m,KK,T1,T2,T3,T6,cdelta,sdelta,cpsih,spsih,vcu)
   
