    The attitude equati These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(sadov,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(sadov)*g(equinoctial).  
