    coeffMzb33[10] = -sqrt(skm) * ((cpsih - 1) * ((m - 2) * skm + 2 * smk * (k1r ^ 2 - 1/2)) * (cpsih + 1) * cdelta ^ 2 + ((-m + 2) * skm - 2 * smk * (k1r ^ 2 - 1/2)) * cpsih ^ 2 + 2 * k1r ^ 2 * smk) / KK * vcu[17] / 6 + spsih * (2 * k1r ^ 2 * smk + skm * m - 2 * skm - smk) * sqrt(skm) * cpsih * sdelta ^ 2 / KK * vcu[14] / 3 - cdelta * (2 * k1r ^ 2 * smk + skm * m - 2 * skm - smk) * sqrt(skm) * spsih * sdelta / KK * vcu[12] / 3 + sqrt(skm) * ((cdelta + 1) * (cdelta - 1) * ((m - 2) * skm + 2 * smk * (k1r ^ 2 - 1/2)) * cpsih ^ 2 + (m - 2) * skm - smk) / KK * vcu[8] / 6 + cdelta * (2 * k1r ^ 2 * smk + skm * m - 2 * skm - smk) * sqrt(skm) * cpsih * sdelta / KK * vcu[6] / 3 - (((m - 2) * skm + 2 * smk * (k1r ^ 2 - 1/2)) * cdelta ^ 2 + (-m + 2) * skm + smk) * sqrt(skm) / KK * vcu[3] / 6
    coeffMzb33[19] = -sqrt(skm) * ((cpsih - 1) * (-2 * skm + smk) * (cpsih + 1) * cdelta ^ 2 + (2 * skm - smk) * cpsih ^ 2 + 2 * smk) / KK * vcu[17] / 6 + spsih * (-2 * skm + smk) * sqrt(skm) * cpsih * sdelta ^ 2 / KK * vcu[14] / 3 - cdelta * (-2 * skm + smk) * sqrt(skm) * spsih * sdelta / KK * vcu[12] / 3 + sqrt(skm) * ((cdelta + 1) * (cdelta - 1) * (-2 * skm + smk) * cpsih ^ 2 - 2 * skm - smk) / KK * vcu[8] / 6 + cdelta * (-2 * skm + smk) * sqrt(skm) * cpsih * sdelta / KK * vcu[6] / 3 - ((-2 * skm + smk) * cdelta ^ 2 + 2 * skm + smk) * sqrt(skm) / KK * vcu[3] / 6
