"""
    srpanalyticalaveragedcoeff_T2_andoyer_cube((ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vcu)
    The attitude equations of motion contain terms Mn*bij, Mn*Sj, with Mn components of srp torque and bij,Sj terms depending on the
    fast Andoyer-Serret angle.  These can be written as  Mn*bij/Sj = sum VV(alpha)*CC(andoyer,equinoctial elements), with alpha constant parameters depending on the considered facet of the satellite. 
    The components of CC are in the form
    CC_j = sum f(andoyer)*g(equinoctial). 
    This function gives the average of the coefficients CC with respect to the Andoyer-Serret angle g.
    Here, the part of the srp torque depending on optic coefficient cdi is considered

    INPUT:
    Consider the Andoyer variables (L,G,H,l,g,psih)
    csigma = L/G
    cssigma = sqrt(1-L^2/G^2)
    cdelta = H/G
    sdelta = sqrt(1-H^2/G^2)
    cpsih  = cos(psih)
    spsih  = sin(psih)
    vcu    = vector containing the terms depending on the equinoctial elements

    OUTPUT: 
    averaged coefficients contained in Mn*bij, Mn.        
"""
function srpanalyticalaveragedcoeff_T2_andoyer_cube(ssigma,csigma,cdelta,sdelta,clA,slA,chA,shA,vcu)
    coeffMxb11 = zeros(60,1); 
    coeffMxb12 = zeros(60,1); 
    coeffMxb13 = zeros(60,1); 
    coeffMxl   = zeros(60,1); 
    coeffMyb21 = zeros(60,1); 
