    coeffMxb11[23] = (-shA * cdelta * ssigma * clA + chA * ssigma * csigma * slA) * vcu[11] / 4 + (chA * cdelta * ssigma * clA + shA * ssigma * csigma * slA) * vcu[5] / 4 + sdelta * ssigma * clA * vcu[2] / 4
    coeffMxb11[24] = 8/3 * sdelta * (shA * chA * ssigma * slA * csigma ^ 2 / 2 + (ssigma * cdelta * clA * chA ^ 2 / 2 - ssigma * cdelta * clA / 2) * csigma) / pi * vcu[17] - 16/3 * sdelta * ((slA * chA ^ 2 * ssigma / 2 - ssigma * slA / 4) * csigma ^ 2 - shA * cdelta * ssigma * chA * clA * csigma / 2) / pi * vcu[14] + 8/3 * (-clA * csigma * ssigma * shA * cdelta ^ 2 + chA * cdelta * ssigma * slA * csigma ^ 2 / 2 + shA * ssigma * clA * csigma / 2) / pi * vcu[12] - 8/3 * sdelta * (shA * ssigma * slA * csigma ^ 2 / 2 + chA * cdelta * clA * csigma * ssigma / 2) * chA / pi * vcu[8] + 8/3 * (chA * clA * csigma * ssigma * cdelta ^ 2 + shA * cdelta * ssigma * slA * csigma ^ 2 / 2 - chA * clA * csigma * ssigma / 2) / pi * vcu[6] + 4/3 * cdelta * clA * csigma * ssigma * sdelta / pi * vcu[3]
    coeffMxb11[26] = (chA * (-clA * csigma ^ 2 * slA + clA * slA) + shA * cdelta * csigma) * vcu[11] / 4 + ((-clA * csigma ^ 2 * slA + clA * slA) * shA - chA * cdelta * csigma) * vcu[5] / 4 - sdelta * csigma * vcu[2] / 4
    coeffMxb11[27] = 8/3 * sdelta * (-chA * clA * slA * shA * csigma ^ 3 + (-cdelta * (clA ^ 2 + 1) * chA ^ 2 / 2 + cdelta * (clA ^ 2 + 1) / 2) * csigma ^ 2 + chA * slA * shA * clA * csigma - (-chA ^ 2 * clA * cdelta / 2 + cdelta * clA / 2) * clA) / pi * vcu[17] - 16/3 * sdelta * (-clA * slA * (chA ^ 2 - 1/2) * csigma ^ 3 + (cdelta * shA * chA * clA ^ 2 / 2 + chA * shA * cdelta / 2) * csigma ^ 2 + (slA * chA ^ 2 - slA / 2) * clA * csigma - cdelta * shA * chA * clA ^ 2 / 2) / pi * vcu[14] + 8/3 * (((clA ^ 2 + 1) * csigma ^ 2 - clA ^ 2) * shA * cdelta ^ 2 + chA * (-clA * slA * csigma ^ 3 + clA * slA * csigma) * cdelta - ((clA ^ 2 + 1) * csigma ^ 2 - clA ^ 2) * shA / 2) / pi * vcu[12] - 8/3 * sdelta * (-clA * slA * shA * csigma ^ 3 + (-chA * cdelta * clA ^ 2 / 2 - cdelta * chA / 2) * csigma ^ 2 + shA * slA * clA * csigma + chA * cdelta * clA ^ 2 / 2) * chA / pi * vcu[8] + 8/3 * (-((clA ^ 2 + 1) * csigma ^ 2 - clA ^ 2) * chA * cdelta ^ 2 + (-clA * slA * csigma ^ 3 + clA * slA * csigma) * shA * cdelta + ((clA ^ 2 + 1) * csigma ^ 2 - clA ^ 2) * chA / 2) / pi * vcu[6] - 4/3 * cdelta * ((clA ^ 2 + 1) * csigma ^ 2 - clA ^ 2) * sdelta / pi * vcu[3]
