# constants parts
"""
    srp_initforaverage_T1(cai,surfi,rhoiv,niv)
    The attitude equations of motion contain terms Mn*bij, MnSj,  with Mn components of srp torque and bij,Sj terms depending on fast
    attitude angles. These terms can be written as Mn*bij/Sj = sum VV(alpha)*CC(attitude var,kep element), with alpha constant parameters depending 
    on the considered facet of the satellite.  This function gives the coefficients VV(alpha)

    INPUT 
        surfi = area of the facet
        rhoiv = centre of mass to facet centroid vector
        niv   = normal unit vector to the facet
        cai   = psrp*(1-ri*si), ri reflectivity, si fraction of reflectivity which is specular

    OUTPUT
    coefficients VV(alpha)
"""
function srp_initforaverage_T1(cai,surfi,rhoiv,niv)
    VV = zeros(30,1);
    count = 0;
    for rr=1:3
        for ii=0:2
            for jj=0:2
                for kk=0:2
                    if (ii+jj+kk)>2
                        break;
                    end
                    count = count+1;
                    VV[count]=rhoiv[rr]*niv[1]^ii*niv[2]^jj*niv[3]^kk*surfi*cai;
                end
            end
        end
    end
    return VV;
end

"""
    srp_initforaverage_T1(cdi,surfi,rhoiv,niv)
    The attitude equations of motion contain terms Mn*bij, MnSj,  with Mn components of srp torque and bij,Sj terms depending on fast
    attitude angles. These terms can be written as Mn*bij/Sj = sum VV(alpha)*CC(attitude var,kep element), with alpha constant parameters depending 
    on the considered facet of the satellite.  This function gives the coefficients VV(alpha)

    INPUT 
        surfi = area of the facet
        rhoiv = centre of mass to facet centroid vector
        niv   = normal unit vector to the facet
        cdi   = 2/3*psrp*(1-ri*si), ri reflectivity, si fraction of reflectivity which is specular

    OUTPUT
    coefficients VV(alpha)
"""
function srp_initforaverage_T2(cdi,surfi,rhoiv,niv)
    VV = zeros(60,1);
    count = 0;
    for rr=1:3
        for ii=0:3
            for jj=0:3
                for kk=0:3
                    if (ii+jj+kk)>3
                        break;
                    end
                    count = count+1;
                    VV[count]=rhoiv[rr]*niv[1]^ii*niv[2]^jj*niv[3]^kk*cdi*surfi;
                end
            end
        end
    end
    return VV;
end

"""
    srp_initforaverage_T1(csi,surfi,rhoiv,niv)
    The attitude equations of motion contain terms Mn*bij, MnSj,  with Mn components of srp torque and bij,Sj terms depending on fast
    attitude angles. These terms can be written as Mn*bij/Sj = sum VV(alpha)*CC(attitude var,kep element), with alpha constant parameters depending 
    on the considered facet of the satellite.  This function gives the coefficients VV(alpha)

    INPUT 
        surfi = area of the facet
        rhoiv = centre of mass to facet centroid vector
        niv   = normal unit vector to the facet
        csi   = 2*psrp*ri*si, ri reflectivity, si fraction of reflectivity which is specular

    OUTPUT
    coefficients VV(alpha)
"""
function srp_initforaverage_T3(csi,surfi,rhoiv,niv)
    VV = zeros(105,1);
    count = 0;
    for rr=1:3
        for ii=0:4
            for jj=0:4
                for kk=0:4
                    if (ii+jj+kk)>4
                        break;
                    end
                    count = count+1;
                    VV[count]=rhoiv[rr]*niv[1]^ii*niv[2]^jj*niv[3]^kk*csi*surfi;
                end
            end
        end
    end
    return VV;
