# numerical (IGNORE)
#############################################
function srpBVV1(psig,psil,m,KK,PP,k,k1r,skmR,smkR,includesfun,angleidx,angin,angout)

    if includesfun
        if angleidx == 5
            angtilde =  psig-(angout+angin)/2.0
            angbar   =  (angout-angin)/2.0
        elseif angleidx == 4
            angtilde =  psil-(angout+angin)/2.0
            angbar   =  (angout-angin)/2.0
        else
            Base.error("angle idx wrong")
        end
        sfun = 1-angbar/pi;
        for ii =1:20
            sfun = sfun  - 2/ii/pi*sin(ii*angbar)*cos(ii*angtilde);
        end
    else
        sfun = 1.0;
    end

    u = 2*KK*psil/pi
    eF  = 2.0*KK*mod(psil,2.0*pi)/pi;
    lambda = Elliptic.Jacobi.am(eF,m);
    sn = sin(lambda);
    cn = cos(lambda);
    dn = sqrt(1.0-m*sn^2.0);
    eP  = ellP(-k,lambda,m); 
    eE  = ellE(lambda,m);
    EE  = ellE(pi/2.0,m);
    zn = eE-eF*EE/KK
    gA  = mod(psig + mod(k1r/skmR*(eF/KK*PP-eP),2.0*pi),2*pi);
    cgA = cos(gA);
    sgA = sin(gA);
    dnkR  = sqrt(1+k*sn^2);

    bij = zeros(9);
    bij[1] = (-sgA*cn*dn*skmR-cgA*sn*k1r)/dnkR;
    bij[2] = ( cgA*cn*dn*skmR-sgA*sn*k1r)/dnkR;
    bij[3] = smkR*cn
    bij[4] = ( sgA*sn*dn*skmR*k1r-cgA*cn)/dnkR;
    bij[5] = (-cgA*sn*dn*skmR*k1r-sgA*cn)/dnkR;
    bij[6] = -smkR*k1r*sn
    bij[7] = smkR*sgA*dnkR
    bij[8] = -smkR*cgA*dnkR
    bij[9] = skmR*dn

    BV = zeros(1980);
    
    count = 0;
    for ii =1:7
        for jj = ii+1:8
            for kk = jj+1:9
                count = count + 1;
                BV[count] = bij[ii]*bij[jj]*bij[kk];
            end
        end
    end

    for ii =1:9
        for kk = 1:9
            count = count + 1;
            BV[count] = bij[ii]*bij[ii]*bij[kk];
        end
    end

    for ii =1:9
        for jj = ii:9
            count = count + 1;
            BV[count]  = bij[ii]*bij[jj];
        end
    end

    for ii =1:9
        count = count + 1;
        BV[count]  = bij[ii];
    end

    count = count + 1;
    BV[count]  = 1;

    BV = vec(BV);

    BVb11   = BV*bij[1];
    BVb12   = BV*bij[2];
    BVb13   = BV*bij[3];
    BVb21   = BV*bij[4];
    BVb22   = BV*bij[5];
    BVb23   = BV*bij[6];
    BVb31   = BV*bij[7];
    BVb32   = BV*bij[8];
    BVb33   = BV*bij[9];
    if smkR == 0.0
        smkR = smkR+1e-15
    end
    BVXpsil = BV*(dn*sn-cn*zn)/smkR;
    BVYpsil = BV*(dn*cn+sn*zn)/smkR/k1r;
    BVZpsil = BV*(dn*zn-m*sn*cn)/skmR;
    
    out = sfun*append!(BVb11,BVb12,BVb13,BVXpsil,BVb21,BVb22,BVb23,BVYpsil,BVb31,BVb32,BVb33,BVZpsil);
    
    return out;
end

function getMeanOverpsilpsig_srp(A,C,k,skm,Jg,includesfun,angleidx,angin,angout)

    smk = 1-skm;
    m   = smk/skm*k;
    KK = ellF(pi/2.0,m)
    PP = ellP(-k,pi/2.0,m);
    k1r = sqrt(1+k);
    skmR = sqrt(skm);
    smkR = sqrt(smk);

    funtoaverage5(psig,psil)= srpBVV1(psig,psil,m,KK,PP,k,k1r,skmR,smkR,includesfun,angleidx,angin,angout);
    funtoaverage4(psil,psig)= srpBVV1(psig,psil,m,KK,PP,k,k1r,skmR,smkR,includesfun,angleidx,angin,angout);
    if angleidx == 5
        vmt = simps2(funtoaverage5,0.0,2.0*pi,0.0,2.0*pi,44,44)/(2*pi)^2.0;
    elseif angleidx == 4
        vmt = simps2(funtoaverage4,0.0,2.0*pi,0.0,2.0*pi,44,44)/(2*pi)^2.0;
    else
        Base.error("angle idx wrong")
    end
    
    return vmt;
    
end

