function srpBV(psig,psil,m,KK,EE,PP,k,k1r,skmR,smkR)
  
    eF  = 2.0*KK*mod(psil,2.0*pi)/pi;
    lambda = Elliptic.Jacobi.am(eF,m);
    sn = sin(lambda);
    cn = cos(lambda);
    dn = sqrt(1.0-m*sn^2.0);
    eP  = ellP(-k,lambda,m); 
    eE  = ellE(lambda,m);
    zn  = eE-eF*EE/KK
    gA  = psig + k1r/skmR*(eF/KK*PP-eP);
    cgA = cos(gA);
    sgA = sin(gA);
    dnkR  = sqrt(1+k*sn^2);

    bij = zeros(9);
    bij[1] = (-sgA*cn*dn*skmR-cgA*sn*k1r)/dnkR;
    bij[2] = ( cgA*cn*dn*skmR-sgA*sn*k1r)/dnkR;
    bij[3] = smkR*cn
    bij[4] = ( sgA*sn*dn*skmR*k1r-cgA*cn)/dnkR;
    bij[5] = (-cgA*sn*dn*skmR*k1r-sgA*cn)/dnkR;
    bij[6] = -smkR*k1r*sn
    bij[7] = smkR*sgA*dnkR
    bij[8] = -smkR*cgA*dnkR
    bij[9] = skmR*dn

    BV = zeros(220);
    
    count = 0;
    for ii =1:7
        for jj = ii+1:8
            for kk = jj+1:9
                count = count + 1;
                BV[count] = bij[ii]*bij[jj]*bij[kk];
            end
        end
    end

    for ii =1:9
        for kk = 1:9
            count = count + 1;
            BV[count] = bij[ii]*bij[ii]*bij[kk];
        end
    end

    for ii =1:9
        for jj = ii:9
            count = count + 1;
            BV[count]  = bij[ii]*bij[jj];
        end
    end

    for ii =1:9
        count = count + 1;
        BV[count]  = bij[ii];
    end

    count = count + 1;
    BV[count]  = 1;
   

    BV = vec(BV);

    BVb11   = BV*bij[1];
    BVb12   = BV*bij[2];
    BVb13   = BV*bij[3];
    BVb21   = BV*bij[4];
    BVb22   = BV*bij[5];
    BVb23   = BV*bij[6];
    BVb31   = BV*bij[7];
    BVb32   = BV*bij[8];
    BVb33   = BV*bij[9];
    if smkR == 0.0
        smkR = smkR+1e-15
    end
    BVXpsil = BV*(dn*sn-cn*zn)/smkR;
    BVYpsil = BV*(dn*cn+sn*zn)/smkR/k1r;
    BVZpsil = BV*(dn*zn-m*sn*cn)/skmR;
    
    out = append!(BVb11,BVb12,BVb13,BVXpsil,BVb21,BVb22,BVb23,BVYpsil,BVb31,BVb32,BVb33,BVZpsil);
    
    return out;
end

