function srpcoeffM_T1(vMAt,cdelta,sdelta,cpsih,spsih)
    MXT1CM = zeros(30,220);
    MYT1CM = zeros(30,220);
    MZT1CM = zeros(30,220);
    t1 = 0.1e1 / pi
    t2 = t1 * spsih
    t3 = vMAt[5]
    t5 = t1 * cpsih
    t6 = vMAt[11]
    MXT1CM[11, 217] = -t3 * t2 / 3 - t6 * t5 / 3
    t9 = t1 * sdelta
    t10 = vMAt[2]
    t12 = cdelta * cpsih
    t13 = t3 * t1
    t15 = cdelta * spsih
    t16 = t6 * t1
    MXT1CM[11, 218] = -t10 * t9 / 3 - t13 * t12 / 3 + t16 * t15 / 3
    t19 = t1 * cdelta
    t21 = cpsih * sdelta
    t23 = spsih * sdelta
    MXT1CM[11, 219] = -t10 * t19 / 3 + t13 * t21 / 3 - t16 * t23 / 3
    t26 = spsih ^ 2
    t27 = vMAt[8]
    t31 = vMAt[14]
    t33 = cpsih ^ 2
    t34 = vMAt[17]
    MXT1CM[12, 205] = -t27 * t26 / 2 - t31 * cpsih * spsih - t34 * t33 / 2
    t37 = vMAt[6]
    t38 = t37 * t23
    t39 = t27 * cpsih
    t40 = t39 * t15
    t41 = vMAt[12]
    t42 = t41 * t21
    t44 = -2 * t33 + 1
    t47 = t34 * cpsih
    t48 = t47 * t15
    MXT1CM[12, 206] = t31 * t44 * cdelta - t38 - t40 - t42 + t48
    t49 = t37 * t15
    t50 = t39 * t23
    t51 = t41 * t12
    t52 = sdelta * t33
    t56 = t47 * t23
    MXT1CM[12, 207] = -t49 + t50 - t51 + t31 * (2 * t52 - sdelta) - t56
    t57 = sdelta ^ 2
    t58 = vMAt[3]
    t60 = t58 * t57 / 2
    t61 = sdelta * cdelta
    t63 = t37 * cpsih * t61
    t64 = cdelta ^ 2
    t65 = t33 * t64
    t67 = t27 * t65 / 2
    t69 = t41 * spsih * t61
    t70 = cpsih * t64
    t71 = t31 * spsih
    t72 = t71 * t70
    t73 = t26 * t64
    MXT1CM[12, 208] = -t60 - t63 - t67 + t69 + t72 - t34 * t73 / 2
    t76 = t58 * t61
    t78 = -2 * t70 + cpsih
    t81 = t27 * cdelta * t52
    t82 = spsih * t64
    t84 = 2 * t82 - spsih
    t87 = t31 * t15 * t21
    t88 = 2 * t87
    t89 = sdelta * t26
    t91 = t34 * cdelta * t89
    MXT1CM[12, 209] = t37 * t78 + t41 * t84 - t76 + t81 - t88 + t91
    t93 = t58 * t64 / 2
    t94 = t57 * t33
    t97 = t57 * cpsih
    t98 = t71 * t97
    t99 = t57 * t26
    MXT1CM[12, 210] = -t93 + t63 - t27 * t94 / 2 - t69 + t98 - t34 * t99 / 2
    t102 = vMAt[7]
    t104 = t102 * t2 * t61
    t105 = 8 * t104
    t107 = 2 * t64 - 1
    t108 = spsih * t107
    t109 = vMAt[9]
    t111 = t109 * t108 * t5
    t112 = 8 * t111
    t114 = vMAt[10]
    t115 = t114 * t2
    t116 = t115 * cdelta * t52
