# AVERAGE WITH RESPECT TO ATTITUDE FAST ANGLES (ANALYTICAL) -- for orbital equations
##################################################################################################################################################

"""
    srpPsrpCRAOm_averaged(satellite,k,k1r,smk,skm,m,KK,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih,rSunV)    
    returns an averaged coefficients C = Psrp*CR*A/m to use for orbital propagation

    INPUT  
    satellite = Dict with the characteristics of the satellite **
    k,k1r,smk,skm,,m,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih, = Sadov variables related quantities
    rSunV = position vector of the sun
   
    **
    satellite=Dict("MomentsOfInertia"=>IV,"intrinsicMagneticMoment"=>IM,"numberOfFacets"=>n,"facets"=>facets,"CD"=>CD);
    IV = [A,B,C] : principal moment of inertia
    IM = intrinsic magnetic moment of the satellite [A m^2]
    n  = number of facets in which the satellite surface is divided
    facets = [facet1...facetn]
        where  
            facetk = [facet_coeff,facet_area,facet_Vinfo,facet_nv]
            facet_coeff = [cai*psrp,cdi*psrsp,csi*psrp], psrp = solar radiation pressure
            facet_area  = area of the facet [m^2]
            facet_Vinfo  = [rhoiv,vv1,vv2,vv3], rhoiv = centre of mass to facet centroid vector [m], vvi = verteces of the facet [m], i=1..3
            facet_nv    = normal unit vector  
            with 
                cai = (1-rf*sp)
                cdi = (2/3*(1-sp)*rf+2/3*(1-rf))
                csi = 2*rf*sp*psrp
                with rf reflectivity and sp specular coefficient (see Benson&Sheers2021)
    CD: aerodynamic coefficient

    
    ***
    Consider an inertial reference Frame XYZ.
    Consider a body reference frame xyz in principal axes of inertia. 
    The reference frame is such that m belongs to in[0,1] and k>0 where
    k = C/A*(B-A)/(C-B) 
    m = k*(C-delta)/(delta-A)
    with
    A,B,C the moments of inertia, A=int(y^2+z^2)dm, B=int(x^2+z^2)dm and C=int(x^2+y^2)dm.
    delta = G^2/2/Phi, with G the angular momentum of the body and Phi the kinetic energy
    Let GV=diag([A,B,C])omV be angular momentum of the body and G = norm(GV)
    (omV = [p,q,r]^T is the angular velocity) 
    Let N be the node between the inertial reference XY plane and the plane
    perpendicular to GV; let N'' be the node between the plane perpendicular 
    to GV and the xy plane:
    k1r = sqrt(1+k)
    smk = m/(k+m)
    skm = k/(m+k)
    T1 = ((m-1.0)*KK+EE)/m/KK;
    T2 = 2.0*(KK-EE)/KK/m^2.0 + (EE-2.0*KK)/m/KK;
    T3 = EE/KK
    KK,EE = complete elliptic integrals of first and second kind with characteristics m
    cdelta = cos(delta), sdelta = sin(delta), delta = inclination angle between 
    the XY plane and the plane perpendicular to GV
    cpsih = cos(psih), spsih = sin(psih), psih = angle between X axis and N
"""
function srpPsrpCRAOm_averaged_psilpsig_V2(satellite,k,k1r,smk,skm,m,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih,rSunV)
    # planet-sun unit vector
    uVect = rSunV/norm(rSunV);   
    Asrp  = srpAcc_averaged_psilpsig(satellite,k,k1r,smk,skm,m,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih,uVect)
    PsrpCRAOm = LinearAlgebra.dot(Asrp,-uVect);
    return PsrpCRAOm;
end

"""
    srpforceaveragedoverpsilpsig(satellite,k,k1r,smk,skm,m,KK,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih,uVect)
    returns the solar radiation pressure acceleration averaged over the Sadov fast angles

    INPUT  
    satellite = Dict with the characteristics of the satellite **
    k,k1r,smk,skm,,m,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih, = Sadov variables related quantities
    uVect = unit vector in the same direction of the position vector of the sun (expressed im the inertial ref frame)
   
    **
    satellite=Dict("MomentsOfInertia"=>IV,"intrinsicMagneticMoment"=>IM,"numberOfFacets"=>n,"facets"=>facets,"CD"=>CD);
    IV = [A,B,C] : principal moment of inertia
    IM = intrinsic magnetic moment of the satellite [A m^2]
    n  = number of facets in which the satellite surface is divided
    facets = [facet1...facetn]
        where  
            facetk = [facet_coeff,facet_area,facet_Vinfo,facet_nv]
            facet_coeff = [cai*psrp,cdi*psrsp,csi*psrp], psrp = solar radiation pressure
            facet_area  = area of the facet [m^2]
            facet_Vinfo  = [rhoiv,vv1,vv2,vv3], rhoiv = centre of mass to facet centroid vector [m], vvi = verteces of the facet [m], i=1..3
            facet_nv    = normal unit vector  
            with 
                cai = (1-rf*sp)
                cdi = (2/3*(1-sp)*rf+2/3*(1-rf))
                csi = 2*rf*sp*psrp
                with rf reflectivity and sp specular coefficient (see Benson&Sheers2021)
    CD: aerodynamic coefficient

    
    ***
    Consider an inertial reference Frame XYZ.
    Consider a body reference frame xyz in principal axes of inertia. 
    The reference frame is such that m belongs to in[0,1] and k>0 where
    k = C/A*(B-A)/(C-B) 
    m = k*(C-delta)/(delta-A)
    with
    A,B,C the moments of inertia, A=int(y^2+z^2)dm, B=int(x^2+z^2)dm and C=int(x^2+y^2)dm.
    delta = G^2/2/Phi, with G the angular momentum of the body and Phi the kinetic energy
    Let GV=diag([A,B,C])omV be angular momentum of the body and G = norm(GV)
    (omV = [p,q,r]^T is the angular velocity) 
    Let N be the node between the inertial reference XY plane and the plane
    perpendicular to GV; let N'' be the node between the plane perpendicular 
    to GV and the xy plane:
    k1r = sqrt(1+k)
    smk = m/(k+m)
    skm = k/(m+k)
    T1 = ((m-1.0)*KK+EE)/m/KK;
    T2 = 2.0*(KK-EE)/KK/m^2.0 + (EE-2.0*KK)/m/KK;
    T3 = EE/KK
    KK,EE = complete elliptic integrals of first and second kind with characteristics m
    cdelta = cos(delta), sdelta = sin(delta), delta = inclination angle between 
    the XY plane and the plane perpendicular to GV
    cpsih = cos(psih), spsih = sin(psih), psih = angle between X axis and N
"""
function srpAcc_averaged_psilpsig(satellite,k,k1r,smk,skm,m,T1,T2,T3,KK,cdelta,sdelta,cpsih,spsih,uVect)


    # srp acc
    numberOfFacets = get(satellite,"numberOfFacets",0);
    facets = get(satellite,"facets",0.0); 
    Vconstants = zeros(24);
    for kk = 1:numberOfFacets
        niv   = facets[kk][4];
        cai   = facets[kk][1][1];
        cdi   = facets[kk][1][2];
        csi   = facets[kk][1][3];
        surfi = facets[kk][2];
        nix   = niv[1];
        niy   = niv[2];
        niz   = niv[3];
        
        VC = zeros(24);
        VC[1] = surfi * cai
        VC[2] = surfi * niz * cai
        VC[3] = surfi * niz ^ 2 * cai
        VC[4] = surfi * niy ^ 2 * cai
        VC[5] = surfi * nix ^ 2 * cai
        VC[6] = surfi * niz * cdi
        VC[7] = surfi * cdi * niz ^ 2
        VC[8] = surfi * niz ^ 3 * cdi
        VC[9] = surfi * cdi * niy ^ 2
        VC[10] = surfi * niy ^ 2 * niz * cdi
        VC[11] = surfi * cdi * nix ^ 2
        VC[12] = surfi * nix ^ 2 * niz * cdi
        VC[13] = surfi * niz ^ 2 * csi
        VC[14] = surfi * niz ^ 3 * csi
        VC[15] = surfi * niz ^ 4 * csi
        VC[16] = surfi * niy ^ 2 * csi
        VC[17] = surfi * niy ^ 2 * niz * csi
        VC[18] = surfi * niy ^ 2 * niz ^ 2 * csi
        VC[19] = surfi * niy ^ 4 * csi
        VC[20] = surfi * nix ^ 2 * csi
        VC[21] = surfi * nix ^ 2 * niz * csi
        VC[22] = surfi * nix ^ 2 * niz ^ 2 * csi
        VC[23] = surfi * nix ^ 2 * niy ^ 2 * csi
        VC[24] = surfi * nix ^ 4 * csi

        Vconstants = Vconstants + VC;
    end

    cxV,cyV,czV = getaveragedterms_psilpsig_srp(uVect[1],uVect[2],uVect[3],k,k1r,smk,skm,m,KK,cdelta,sdelta,cpsih,spsih,T1,T2,T3);
    Fsrp = zeros(3);
    Fsrp[1] = LinearAlgebra.dot(Vconstants,cxV);
    Fsrp[2] = LinearAlgebra.dot(Vconstants,cyV);
    Fsrp[3] = LinearAlgebra.dot(Vconstants,czV);

    Asrp = Fsrp/satellite["mass"]/1000.0;

    return Asrp;

end

