        VC[3] = surfi * cai * niz ^ 2
        VC[4] = surfi * niy * cai
        VC[5] = surfi * niy * niz * cai
        VC[6] = surfi * cai * niy ^ 2
        VC[7] = surfi * nix * cai
        VC[8] = surfi * nix * niz * cai
        VC[9] = surfi * nix * niy * cai
        VC[10] = surfi * cai * nix ^ 2
        VC[11] = surfi * niz * cdi
        VC[12] = surfi * cdi * niz ^ 2
        VC[13] = surfi * niz ^ 3 * cdi
        VC[14] = surfi * niy * cdi
        VC[15] = surfi * niy * niz * cdi
