# -------------- 
function getaveragedterms_psilpsig_srp(cU1,cU2,cU3,k,k1r,smk,skm,m,KK,cdelta,sdelta,cpsih,spsih,T1,T2,T3)
    cxV = zeros(24);
    cyV = zeros(24);
    czV = zeros(24);

    t1 = 0.1e1 / pi
    cxV[1] = -t1 * cU1 / 3
    t4 = sqrt(skm)
    t7 = cU1 * sdelta * spsih
    t8 = cU2 * cpsih
    t10 = cU3 * cdelta
